    false,nt"url": null,nt"notes": "This Sea-Level Affecting Marshes Model
    (SLAMM) report presents a model for projecting the effects of sea-level rise on
    coastal marshes and related habitats on Caloosahatchee National Wildlife Refuge.
     The model is spatially explicit, using GIS technology to produce maps and tables
    that summarize the projected effects.  The SLAMM simulations include five primary
    processes that affect wetland fate under different scenarios of sea-level rise including:
    inundation, erosion, overwash, saturation, and accretion.",nt"license_title":
